INSERT INTO `table_about` (`id`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `description`, `keywords`, `type`, `tenen`, `motaen`, `noidungen`) VALUES
(1, 'âs', 'as', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident.</p>\r\n', '<p style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px; background-color: rgb(255, 255, 255);\">Với gu thẩm mỹ hiện đại và tình yêu đặc biệt dành cho cái đẹp, FETISH<strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\"> </strong>mong muốn những sản phẩm mà mình truyền tải đến sẽ tạo nên hình tượng thời trang của người phụ nữ hiện đại, phóng khoáng, tự tin và hạnh phúc.<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\n<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\n </p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px; background-color: rgb(255, 255, 255);\">Ngoài mong muốn tôn vinh được sự tự tin và nâng tầm phong cách thời trang cho phái đẹp. Song song đó, chúng tôi còn mong muốn thổi một làn gió mới vào tủ đồ của phái đẹp qua những mẫu thiết kế luôn được làm mới với phong cách thời trang đa dạng cùng với sự chi tiết và tỉ mỉ từ khâu chọn chất liệu cho đến kỹ thuật tinh tế của mỗi sản phẩm mang tên <b>FETISH</b>.<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\n<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\n<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\n<br style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\" />\r\nThế giới của <b>FETISH</b> mang đến cho phái đẹp như lời khẳng định giá trị của một thương hiệu thời trang thiết kế cao cấp và cũng mong muốn đây sẽ là điểm dừng chân thời trang đầu tiên của quý cô khi chọn lựa ngôn ngữ thời trang bản thân.</p>\r\n', 'hinh-gt-7789.jpg', '', 1, 1, 1432957701, 1648859063, '', '', '', 'about', '', '<p>We are Mauve - a Vietnamese local brand. We brand us as a women clothing with Oriental style. Focusing on materials, details & subtle cut-out is our priority to bring you convenience and comfort.<br />\r\n*Fresh is an adjective we want to lock you in. Let us lock you in.<br />\r\nAs a gift from Saigon, we hope you can find your true soul dress from Mauve</p>\r\n', ''),
