(3, '', '', '', '<p>Địa chỉ: 43 - Phạm Văn Đồng - Phường 3 - Q. Gò Vấp - TP.HCM</p>\r\n\r\n<p>SĐT: 0898678765 - 0707060262</p>\r\n\r\n<p>Email: lesustore@gmail.com</p>\r\n\r\n<p>Giờ mở cửa: 10h - 21h Thứ 2 - Thứ 7</p>\r\n\r\n<p style=\"background:white;\"> </p>\r\n', '', '', 1, 0, 1457256777, 1622212312, '', '', '', 'lienhe', '', '', '<p style=\"background:white;\"><span style=\"font-size:12px;\"><span style=\"color:#1C1E21;\"><span style=\"font-family:lato;\">As a gift from Saigon, we hope you can find your true soul dress from Mauve</span></span></span></p>\r\n\r\n<p style=\"background:white;\"><span style=\"font-size:12px;\"><span style=\"color:#1C1E21;\"><span style=\"font-family:lato;\">Find us at instagram : mauve.vn</span></span></span></p>\r\n\r\n<p style=\"background:white;\"><span style=\"font-size:12px;\"><span style=\"color:#1C1E21;\"><span style=\"font-family:lato;\">Visit us at 136/6 Lê Thánh Tôn, B</span></span><span style=\"color:#1C1E21;\">ế</span><span style=\"color:#1C1E21;\"><span style=\"font-family:lato;\">n Thành, District 1, HCMC</span></span></span></p>\r\n\r\n<p style=\"background:white;\"><span style=\"font-size:12px;\"><span style=\"color:#1C1E21;\"><span style=\"font-family:lato;\">P: 0896620599</span></span></span></p>\r\n'),
