;\"><span style=\"font-size:14px;\"><span style=\"line-height:1.5em;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Khách hàng có thể liên hệ qua page Facebook/Instagram của LESU hoặc liên hệ trực tiếp vào số điện thoại: <span style=\"color:#800080;\">070 706 0262</span> để được cung cấp mọi thông tin về đơn hàng.</span></span></span></p>\r\n\r\n<p helvetica=\"\" min-height:=\"\" style=\"margin: 0px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102);\">   —</span></span><strong><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102);\"> </span><span style=\"line-height:1.5em;\">Có được kiểm tra hàng trước khi thanh toán không?</span></span></strong></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"font-size:14px;\"><span style=\"line-height:1.5em;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Hiện tại, LESU hỗ trợ đồng kiểm tra hàng cùng shipper đối với các đơn hàng thuộc TP.Hồ Chí Minh. Tuy nhiên, LESU hiện chưa hỗ trợ khách hàng thử hàng, chưa hỗ trợ giao hàng để khách hàng kiểm tra về sự yêu thích dành cho sản phẩm.</span></span></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 80px; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"font-size:14px;\"><span style=\"line-height:1.5em;\"><span style=\"font-family:arial,helvetica,sans-serif;\">Ngoài ra, các tỉnh thành khác, LESU hiện chưa có chính sách đồng kiểm tra hà