(131, 0, 0, 0, 0, 'thiet-ke-khong-ten-7-3247.png', 'thiet-ke-khong-ten-71193_280x220.png', '', 'TƯỢNG - Fall 2020', 'tuong-fall-2020', 'Bộ Sưu Tập mới - TƯỢNG\r\nTƯỢNG - sự rắn rỏi sắt son qua năm tháng, ẩn sâu trong làn mây nhẹ nhàng là những tâm hồn mạnh mẽ độc lập của người phụ nữ.\r\nMauve một lần nữa, khai thác về hình ảnh của người phụ nữ ở một góc nhìn khác trong Mauve. \r\nVới động từ \'tạc’, Mauve gửi gắm thông điệp về những guồng quay của cuộc sống, qua bao năm tháng để có thể nhận diện mình. Một động từ mạnh mẽ như ‘tạc’ mới đủ sức toát nên được sắc thái riêng biệt trong mỗi người phụ nữ.\r\n‘TƯỢNG’ được ra mắt vào giữa thu - với những gam màu trung tính. Nhưng đâu đó thể hiện sự đối lập trong từng chi tiết - đa chiều, mềm mại có, rắn rỏi có. ', '', 195, 1, 0, 0, 1605948018, 1605949070, '', '', '', 0, 'TƯỢNG - Fall 2020', '', '', 'album', ''),
