(129, 0, 0, 0, 0, 'poster-5x4-(web)-9663.png', 'poster-5x4-(web)1660_280x220.png', '', 'AUTUMN MOON 2020 Campaign', 'autumn-moon-2020-campaign', 'Lơ thơ ngắm nhìn chút hương, chút sắc của những ngày trăng thu.\r\n<br>\r\nNếu được hỏi, Mauve sẽ là ai khi mỗi dịp chuyển mùa ghé ngang?\r\nMauve vẫn là một cô gái, chọn cho mình vẻ êm đềm, cùng một khao khát niềm vui, cái đẹp, trôi theo dòng chảy của năm tháng, vẫn mang trong mình một vẻ vẹn nguyên. Nhưng có chút dặn dày, chậm và êm.\r\n<br>\r\nCũng từ bao điều khát khao thuở đầu, dòng chảy trở nên trọn vẹn và đủ đầy xúc cảm. Như những nét đẹp trầm lắng ẩn sâu bên trong mỗi người phụ nữ, thời gian trôi tạo ra những điều chân mỹ.\r\n<br>\r\nTrong lần kết hợp giữa Mauve và Cuội. Mauve mang theo sự chuyển mình với sự thay đổi đặc biệt, sự tinh xảo trong đường cắt may, lựa chọn màu sắc để toát ra bên ngoài vẻ đẹp từ trong của người phụ nữ. Cũng chính là cái mỹ mãn mà Mauve và Cuội đang hướng đến.', '', 347, 1, 0, 0, 1600357542, 1600358973, '', '', '', 0, 'AUTUMN MOON 2020 Campaign', 'Lơ thơ ngắm nhìn chút hương, chút sắc của những ngày trăng thu.\r\n<br>\r\nNếu được hỏi, Mauve sẽ là ai khi mỗi dịp chuyển mùa ghé ngang?\r\nMauve vẫn là một cô gái, chọn cho mình vẻ êm đềm, cùng một khao khát niềm vui, cái đẹp, trôi theo dòng chảy của năm tháng, vẫn mang trong mình một vẻ vẹn nguyên. Nhưng có chút dặn dày, chậm và êm.\r\n<br>\r\nCũng từ bao điều khát khao thuở đầu, dòng chảy trở nên trọn vẹn và đủ đầy xúc cảm. Như những nét đẹp trầm lắng ẩn sâu bên trong mỗi người phụ nữ, thời gian trôi tạo ra những điều chân mỹ.\r\n<br>\r\nTrong lần kết hợp giữa Mauve và Cuội. Mauve mang theo sự chuyển mình với sự thay đổi đặc biệt, sự tinh xảo trong đường cắt may, lựa chọn màu sắc để toát ra bên ngoài vẻ đẹp từ trong của người phụ nữ. Cũng chính là cái mỹ mãn mà Mauve và Cuội đang hướng đến.', '', 'album', ''),
(130, 0, 0, 0, 0, '105699460_2636196153310696_6743708831472245121_o-0339.jpg', '105699460_2636196153310696_6743708831472245121_o8643_280x220.jpg', '', 'Summer 2020 - AVOCADO', 'summer-2020-avocado', 'Quen hoá thành lạ, Mauve biến hoá những thiết kế dễ ứng dụng trong cuộc sống hằng ngày với phối màu tưởng chừng không thân thuộc nhưng lại rất ăn rơ.\r\n<br>\r\nSự kết hợp dáng váy, màu sắc, chất liệu cũng như từng chi tiết nhỏ. Mauve tin rằng những thiết kế trong BST Avocado sẽ làm chị không khỏi nao lòng mỗi khi nhớ tới.', '', 182, 1, 0, 0, 1600358322, 1600358350, '', '', '', 0, 'Summer 2020 - AVOCADO', 'Quen hoá thành lạ, Mauve biến hoá những thiết kế dễ ứng dụng trong cuộc sống hằng ngày với phối màu tưởng chừng không thân thuộc nhưng lại rất ăn rơ.\r\n<br>\r\nSự kết hợp dáng váy, màu sắc, chất liệu cũng như từng chi tiết nhỏ. Mauve tin rằng những thiết kế trong BST Avocado sẽ làm chị không khỏi nao lòng mỗi khi nhớ tới.', '', 'album', ''),
(125, 0, 0, 0, 0, 'floral1-0936.jpg', 'floral16399_280x220.jpg', '', 'Mauve Spring Summer 2020', 'mauve-spring-summer-2020', 'Bộ sưu tập của sự giao mùa, giữa mùa nghỉ xuân kéo dài bước qua đầu mùa hạ. Với những thước vải hoa và mang màu sắc giao thoa xuân - hè, có chút sôi nổi tông ấm vàng đan xen màu của hoa và lá.\r\n', '', 301, 1, 0, 0, 1593693818, 1593694440, '', '', '', 0, 'Mauve Spring Summer 2020', 'Bộ sưu tập của sự giao mùa, giữa mùa nghỉ xuân kéo dài bước qua đầu mùa hạ. Với những thước vải hoa và mang màu sắc giao thoa xuân - hè, có chút sôi nổi tông ấm vàng đan xen màu của hoa và lá.', '', 'album', ''),
(123, 0, 0, 0, 0, 'coversig-4307.jpg', 'coversig6780_280x220.jpg', '', 'MAUVE SIGNATURE', 'mauve-signature', 'Là dáng váy được chọn là mẫu váy chủ đạo của tiệm Mauve, Mauve Signature dress được tận dụng triệt để khổ vải trên bàn cắt để hạn chế hết mức phần vải thừa. Những chi tiết đường viền trong của cổ áo và tay áo cũng được tiệm chọn màu viền đan xen ngẫu nhiên giữa các màu váy. Đó là bí mật mà chỉ có người sở hữu và mặc chiếc váy mới được bật mí.', '', 336, 1, 0, 0, 1593575033, 1593683646, 'MAUVE SIGNATURE', '', '', 0, 'MAUVE SIGNATURE', 'Là dáng váy được chọn là mẫu váy chủ đạo của tiệm Mauve, Mauve Signature dress được tận dụng triệt để khổ vải trên bàn cắt để hạn chế hết mức phần vải thừa. Những chi tiết đường viền trong của cổ áo và tay áo cũng được tiệm chọn màu viền đan xen ngẫu nhiên giữa các màu váy. Đó là bí mật mà chỉ có người sở hữu và mặc chiếc váy mới được bật mí.', '', 'album', ''),
(132, 0, 0, 0, 0, '', '', '', 'Chính sách đổi hàng', 'chinh-sach-doi-hang', '', '<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p><strong style=\"font-size: 20px; color: rgb(255, 0, 102);\"><span style=\"font-family:arial,helvetica,sans-serif;\">► ĐIỀ<span style=\"font-size:20px;\">U KIỆN ĐỔI H</span>ÀNG </span></strong></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">​​• LESU chấp nhận đổi hàng trong vòng 24h kể từ thời điểm nhận hàng đối với đơn hàng online và trong vòng 24h kể từ thời điểm thanh toán đối với đơn hàng mua trực tiếp tại cửa hàng.</span></span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">​​• Chỉ áp dụng đổi hàng với sản phẩm nguyên giá. Đối với các sản phẩm giảm giá/khuyến mãi, LESU không hỗ trợ đổi hàng.</span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">​​• Sản phẩm đổi hàng là sản phẩm còn nguyên vẹn và tem mác, chưa có dấu hiệu đã qua sử dụng, chưa giặt tẩy và chưa thay đổi kích thước ban đầu.</span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">• Sản phẩm đổi hàng có giá trị cao hơn hoặc bằng giá trị sản phẩm đã thanh toán trước đó. LESU không hỗ trợ hoàn tiền nếu khách hàng quyết định đổi hàng sang sản phẩm có giá trị thấp hơn.</span><br />\r\n<span style=\"font-size: 14px; font-family: arial, helvetica, sans-serif;\">​​• LESU không đồng ý trả hàng dù với bất kỳ lí do nào</span><span style=\"font-size: 14px;\">.</span></span></p>\r\n\r\n<p><br />\r\n </p>\r\n\r\n<p><span style=\"color:#ff0066;\"><span style=\"font-size:20px;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">► CÁC TRƯỜNG HỢP ĐƯỢC ÁP DỤNG ĐỔI HÀNG</span></strong></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family: arial, helvetica, sans-serif;\">​​• ​​Sản phẩm bị lỗi từ phía nhà sản xuất.<br />\r\n​​• Hỗ trợ đổi size (nếu còn hàng). LESU không hỗ trợ đổi màu hoặc đổi vì lí do khách hàng không thích sản phẩm nữa.<br />\r\n​​• Sản phẩm nhận được không đúng mẫu, màu, size đã đặt hàng trong trường hợp mua hàng Online. </span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif;\">​​• Trường hợp sản phẩm lỗi không rõ ràng, LESU sẽ chỉ hỗ trợ khi khách hàng cung cấp video mở gói hàng (kể từ lúc gói hàng còn nguyên vẹn tình trạng như khi giao nhận với shipper, cho đến khi phát hiện lỗi sản phẩm). Vì vậy, LESU khuyến khích khách hàng luôn quay video mở gói hàng</span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif;\">​​• Các trường hợp phát sinh khác, LESU sẽ có giải pháp hỗ trợ khách hàng tốt nhất.​</span></span></span></p>\r\n\r\n<p><br />\r\n </p>\r\n\r\n<p><span style=\"color:#ff0066;\"><span style=\"font-size:20px;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">► CÁCH THỨC ĐỔI HÀNG</span></strong></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-size:12px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"line-height:2em;\"><em><span style=\"color:#ff0066;\">Khách hàng vui lòng liên hệ trước với LESU qua page Facebook/Instagram hoặc liên hệ trực tiếp vào số điện thoại:</span> <span style=\"color:#800080;\">0898678765</span> - <span style=\"color:#800080;\">0707060262</span></em></span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height: 2em;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">​​• <span style=\"font-size: 14px;\">Khách hàng tại TP. Hồ Chí Minh</span></span></strong><br />\r\n<font face=\"arial, helvetica, sans-serif\" style=\"font-size: 16px;\">- <span style=\"font-size:14px;\"><em><u>Cách 1</u></em>:</span> <span style=\"font-size:14px;\">Đến trực tiếp cửa hàng LESU đổi hàng. Khách hàng vui lòng đến cửa hàng sau 12h00</span>.</font><br />\r\n<span style=\"font-size: 14px;\">- </span><u style=\"font-size: 14px;\"><em><span style=\"font-family:arial,helvetica,sans-serif;\">Cách 2</span></em></u><span style=\"font-size: 14px;\">:</span><em style=\"font-size: 14px; font-family: arial, helvetica, sans-serif;\"><span style=\"font-family:arial,helvetica,sans-serif;\"> </span></em><span style=\"font-size: 14px; font-family: arial, helvetica, sans-serif;\">Gửi hoàn sản phẩm cho LESU thông qua các dịch vụ giao hàng công nghệ nhanh (Grab/Ahamove/Be/Now/Gojek...). </span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height: 2em;\"><span style=\"font-family: arial, helvetica, sans-serif;\"><span style=\"font-size: 14px;\">​​•<strong> Khách hàng tại các Tỉnh/Thành khác</strong></span></span><br />\r\n<font face=\"arial, helvetica, sans-serif\" style=\"font-size: 14px;\"><span style=\"font-size:14px;\">Khách hàng gửi hoàn sản phẩm và gửi biên nhận đã gửi hàng cho LESU trong vòng 24h kể từ lúc LESU xác nhận đổi hàng. Khi nhận được hàng chuyển hoàn, LESU sẽ liên hệ lại khách hàng và gửi đổi hàng cho khách hàng.</span></font></span></p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"line-height:2em;\"><em>LƯU Ý: <br />\r\n- Trường hợp đổi size: Khách hàng vui lòng chi trả toàn bộ phí ship 2 chiều.<br />\r\n- Trường hợp hàng lỗi/sai mẫu: LESU sẽ chi trả toàn bộ phí ship 2 chiều.</em></span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"text-align: center;\"><strong style=\"color: rgb(255, 0, 102); font-family: arial, helvetica, sans-serif; text-align: center;\"><span style=\"line-height: 2em;\"><span style=\"font-size: 20px;\">——</span></span></strong><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"color:#ff0066;\"><strong><span style=\"line-height:2em;\"><span style=\"font-size: 20px;\">— LESU XIN CẢM ƠN </span></span></strong></span></span><strong style=\"color: rgb(255, 0, 102); font-family: arial, helvetica, sans-serif; text-align: center;\"><span style=\"line-height: 2em;\"><span style=\"font-size: 20px;\">———</span></span></strong></p>\r\n\r\n<p> </p>\r\n\r\n<ul>\r\n</ul>\r\n', 345, 1, 1, 0, 1617605466, 1631269625, '', '', '', 0, '', '', '', 'chinhsach', ''),
