(137, 0, 0, 0, 0, '', '', '', 'Chính sách tích điểm', 'chinh-sach-tich-diem', '', '<p> </p>\r\n\r\n<p><strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; color: rgb(255, 0, 102);\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; line-height: 2em;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-size: 22px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: arial, helvetica, sans-serif;\">► ĐIỀU KIỆN TÍCH ĐIỂM</span></span></span></span></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\">• </span><span font-size:=\"\" helvetica=\"\">Khách hàng sẽ trở thành khách hàng thân thiết của LESU ngay sau khi thanh toán hoá đơn đầu tiên và sẽ được hưởng các ưu đãi riêng biệt.</span></span></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Khách hàng cung cấp cho LESU thông tin mua hàng (Tên, Số điện thoại, Ngày sinh) vào mỗi lần mua hàng, hệ thống tích điểm của LESU sẽ tự động cộng điểm.</span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"> </p>\r\n\r\n<p style=\"margin-left: 40px;\"> </p>\r\n\r\n<p><strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; color: rgb(255, 0, 102);\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; line-height: 2em;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-size: 22px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: arial, helvetica, sans-serif;\">► CÁCH THỨC TÍCH ĐIỂM</span></span></span></span></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\">• </span><span font-size:=\"\" helvetica=\"\">Hoá đơn có giá trị 100.000đ sẽ tương ứng với 100.000 điểm trên hệ thống.</span></span></span><br />\r\n<span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Tương tự, hoá đơn có giá trị 2.000.000đ sẽ tương ứng với 2.000.000 điểm trên hệ thống.</span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Mỗi khách hàng chỉ áp dụng tích điểm vào 1 số điện thoại khi mua hàng, không cộng dồn điểm từ nhiều số điện thoại, không thay đổi số điện thoại đã tích điểm</span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Trường hợp khách hàng thay đổi số điện thoại sẽ không nhận được điểm đã tích luỹ ở số điện thoại trước đó.</span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Điểm tích luỹ không có giá trị quy đổi thành tiền mặt, chỉ dùng để áp dụng khi thanh toán hoá đơn mua hàng.</span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"> </p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Điểm tích luỹ sẽ được cộng gộp bao gồm cả hoá đơn mua hàng tại cửa hàng và hoá đơn mua hàng online.</span></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\"><em>  </em></span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\"><span style=\"font-size:12px;\"><em><u>Ví dụ</u>:</em></span><br />\r\n    <span style=\"font-size:12px;\"><em> Ngày 1, khách hàng mua hàng tại cửa hàng với hoá đơn 500.000đ.<br />\r\n     Ngày 2, khách hàng đặt hàng đơn online với hoá đơn có giá trị 700.000đ.<br />\r\n   </em></span></span><span style=\"font-size:12px;\"><em><span style=\"font-family: arial, helvetica, sans-serif;\"> Vậy, tổng điểm tích luỹ thời điểm đó của khách hàng sẽ là: 500.000 + 700.000 = 1.200.000 điểm.</span></em></span></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Trường hợp khách hàng muốn dùng ưu đãi VIP vào lần mua hàng trực tiếp tại cửa hàng, đơn hàng sẽ được áp dụng chính sách VIP dành cho khách hàng mua hàng tại cửa hàng.</span></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"><span style=\"line-height:2em;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">• </span><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">Trường hợp khách hàng muốn dùng ưu đãi VIP vào lần đặt hàng online, đơn hàng online đấy sẽ được áo dụng chính sách VIP dành cho khách hàng đặt hàng online.</span></span></p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"> </p>\r\n\r\n<p helvetica=\"\" style=\"margin: 0px 0px 0px 40px; font-stretch: normal; font-size: 12px; line-height: normal;\"> </p>\r\n\r\n<p><strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; color: rgb(255, 0, 102);\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; line-height: 2em;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-size: 22px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: arial, helvetica, sans-serif;\">► MUA HÀNG TRỰC TIẾP TẠI CỬA HÀNG</span></span></span></span></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><spa