style=\"font-family: arial, helvetica, sans-serif;\"><strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;\">Ưu đãi tích điểm dành cho khách hàng VIP:</strong></span></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102); background-color: rgb(255, 255, 255);\">— </span>Tổng điểm tích luỹ <span style=\"color:#800080;\">từ 5.000.000 điểm - dưới 7.000.000 điểm</span>.<br />\r\n        Giảm giá 5% giá trị hoá đơn cho tất cả các lần mua hàng tại cửa hàng.</span></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102); background-color: rgb(255, 255, 255);\">— </span>Tổng điểm tích luỹ <span style=\"color:#800080;\">từ 7.000.000 điểm - dưới 10.000.000 điểm</span>.<br />\r\n        Giảm giá 10% giá trị hoá đơn cho tất cả các lần mua hàng tại cửa hàng.</span></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102); background-color: rgb(255, 255, 255);\">— </span>Tổng điểm tích luỹ <span style=\"color:#800080;\">từ 10.000.000 điểm trở lên</span>.<br />\r\n        Giảm giá 15% giá trị hoá đơn cho tất cả các lần mua hàng tại cửa hàng.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">    <span style=\"line-height:2em;\"> ♦Thời gian áp dụng: Vĩnh viễn.</span></span></span></p>\r\n\r\n<p><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">     ♦Các ưu đãi trên không áp dụng cùng các chư