ze:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">     ♦Điểm tích luỹ chỉ được tính cộng gộp giá trị sản phẩm, không bao gồm phí vận chuyển.</span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p><strong style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: Segoe-UI; font-size: 13px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; color: rgb(255, 0, 102);\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; line-height: 2em;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-size: 22px;\"><span style=\"margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: arial, helvetica, sans-serif;\">► ƯU ĐÃI SINH NHẬT DÀNH CHO TẤT CẢ KHÁCH HÀNG</span></span></span></span></strong></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102); background-color: rgb(255, 255, 255);\">   </span>LESU tri ân mừng sinh nhật khách hàng thân thiết dựa trên thông tin ngày sinh mà khách hàng đã cung cấp khi mua hàng</span></span></span></p>\r\n\r\n<p><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"caret-color: rgb(255, 0, 102); background-color: rgb(255, 255, 255);\">     — </span>Khách hàng vui lòng cung cấp chính xác ngày sinh giống với Giấy tờ tuỳ thân khi mua hàng để được hưởng ưu đãi:</span></span></span></p>\r\n\r\n<p style=\"margin-left: 40px;\"><span style=\"line-height:2em;\"><span style=\"font-size:14px;\"><span style=\"font-family:arial,helvetica,sans-serif;\"><span style=\"color:#800080;\">Giảm giá 10% giá trị hoá đơn, tối đa 200.000đ.</span></span></span></span></p>\r\n\r\n<p> </p>\r\n\r\n